import logo from './logo.svg';
import './App.module.css';
import s from './App.module.css'
import Header from "./compo/Header/Header";
import Nav from "./compo/Nav/Nav";
import Profile from "./compo/Profile/Profile";
import Dialogs from "./compo/Message/Dialogs";
import Friends from "./compo/Nav/Friends/Friends"
import {BrowserRouter, Routes, Route } from 'react-router-dom';



function App(props) {


  return (
    <BrowserRouter>
    <div className={s.grid}>
        <Header/>
        <Nav/>
        <div className={s.content}>
            <Routes>
                <Route path="/dialogs/*" element={<Dialogs stateDialogs={props.state.dialogsPage} />}/>
                <Route path="/profile" element={<Profile statePosts={props.state.profilePage} />}/>
                <Route path={"/friends"} element={<Friends stateFriends={props.state.friendList}/>} />
            </Routes>
        </div>
    </div>
    </BrowserRouter>
  );
}

export default App;
